import React from 'react';
import ContractForm from '../components/ContractForm';
import Footer from '../components/Footer';
import '../styles/form.css';

function Form() {
  return (
    <div>
      <form>
        <ContractForm />
      </form>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default Form;
